import { Form, Button, Alert, Breadcrumb, Card, BreadcrumbItem } from 'react-bootstrap';
import SecondPage from './SecondPage';
import {BrowserRouter as Router} from "react-router-dom";
function FirstPage(){
    return (<div>
        <Card style = {{color: '#000'}}>
          <Card.Img src = 'https://picsum.photos/id/237/1000/500'/>
          <Card.Body>
            <Card.Title>
              Welcome To the Page :
            </Card.Title>
            <Button  const path = '/SecondPage' >SignUp</Button>
          </Card.Body>
        </Card>
    </div>);
}

export default FirstPage;
